import React from 'react';

function DataStructure() {
  return (
    <div>
      <h1>Cấu trúc dữ liệu</h1>
      <p>
        Cấu trúc dữ liệu là cách tổ chức và lưu trữ dữ liệu để có thể sử dụng hiệu quả.
        Dưới đây là một số cấu trúc cơ bản thường gặp:
      </p>
      <ul>
        <li><strong>Array (Mảng):</strong> Truy cập theo chỉ số, kích thước cố định.</li>
        <li><strong>Linked List:</strong> Danh sách các node liên kết với nhau.</li>
        <li><strong>Stack:</strong> LIFO – dùng trong duyệt cây, tính biểu thức.</li>
        <li><strong>Queue:</strong> FIFO – dùng trong xử lý job, hệ thống hàng đợi.</li>
        <li><strong>Hash Table:</strong> Tìm kiếm O(1), lưu trữ key-value.</li>
        <li><strong>Tree:</strong> Biểu diễn cấu trúc phân cấp như DOM, hệ thống file.</li>
        <li><strong>Graph:</strong> Dữ liệu phi tuyến, biểu diễn quan hệ phức tạp.</li>
      </ul>
    </div>
  );
}

export default DataStructure;
